import React from "react";
import s from "./ThisDay.module.scss"; // с большой буквы
import Select from 'react-select';
import { GlobalSwgSelector } from "../../../../assets/icons/global/GlobalSwgSelector";


interface Props {
}


export const ThisDay = (props: Props) => {
  return <header className={s.this_day}>


        <div className={s.top_block}> 
          <div className={s.top_block_wrapper}>
          <div className={s.this_temp}>20°</div>
          <div className={s.this_day_day}>Сегодня</div>
          </div>

          <GlobalSwgSelector id = "sun" />
        </div>


        <div className={s.bottom_block}> 
          <div className={s.this_time}>
            Время: <span>20:06</span>
          </div>
          <div className={s.this_city}>
            Город: <span>Минск</span>
          </div>
        </div>
    

    </header>
}

export default ThisDay;
